import React, {Component} from 'react';

//stateless functional component
const NavBar = () => {
	state = {
		styles:{
			width:1920,
			height:100,
			backgroundColor:'grey',
		},
	}
	return(
		<div style={this.state.styles} className="navbar">
			<h1 className="total">{this.props.totalCounters}</h1>
		</div>
	);
};

/*class NavBar extends Component{

	render(){
	}
}*/

export default NavBar;
